  input: TEXT,F3XA,,"Response to letter dated June 24, 2005; period covered 10/14/04-11/22/04.  This
    response follows each bullet point.  The receipts from the Tenebaum campaign have
    been properly recorded as transfers.  The Schedule F total for the Tenenbaum campaign
    has been corrected by prior amended reporting.  The allocation ration 200404 has
    been added the Schedule H2.  The exempt activities mentioned in your letter have
    been recatagorized as FEA activity, which corrects the next three bullet points.  The
    payments for professional services are paid to independent consultants who work
    for themselves.  Each payment is reported on a 1099 at year-end.  The mail house
    handling expenditures have been clarified to accurately reflect their nature.  The
    Neighborhood Headquarters project is a State Party initiative that promotes party
    activity throughout the state.  The project is not candidate specific. All itemized
    disbursements now have complete descriptions of their activity.  The intern related
    disbursements can be clarified together as being made for mileage and other incidentals.  No
    funds transferred into from national committees were used for prohibited activities.  The
    election night activities were not fundraising related.  The Levin transfers in
    are now more in line with the expenditures as required by law.  The Democratic
    Party of SC strives for accurate and timely reporting."
